import { react, useState } from "react";
import axios from "axios";

export default function Usetoken() {
  const [item, setItem] = useState([]);



  axios(config)
    .then(function (response) {
      setItem(JSON.stringify(response.data));
    })
    .catch(function (error) {
      console.log(error);
    });

  return <>

        {console.log(item)}
  </>;
}
